import React from "react";
import './Accord.css'
import {question} from './api'
import Button from '@material-ui/core/Button'

const Accord = (()=>{
  return (<>
        <Button>hii</Button>
        <div>
                  {question.id}
          {/* {question.map((values ,index)=>{
              return <h1>{index+1}.{values}</h1>
          })} */}

        </div>
  </>)  
})
export default Accord
